          background: #f8f8f8;
        }
        li:last-child {
          border-bottom: none;
        }
      `}</style>

      <nav>
        <ul>
          {nameList.map((person, i) => {
            return (
              <>
                <li key={person.nameId}>{person.name}</li>
              </>
            );
          })}
        </ul>
      </nav>
    </div>
  );
};

export default List;
